MORE GOOD NEWS➞OneMain Financial is the latest company to announce investments in their workers thanks to #TaxReform. 

@OneMain has over 1,700 branches in 44 states, including 13 locations in and around our 16th district.

Read more here: https://t.co/Tjee0sJAAy https://t.co/PkxURq5gql

Another Ohio company rewards employees because of #TaxReform:

@_Demotech, a financial analysis firm in Columbus has announced bonuses to its employees, as well as making the maximum contribution to the retirement account of eligible employees.

Read here: https://t.co/NgQSpV7DIc https://t.co/lBmrujS1M1

ANOTHER WIN FOR AMERICA AND THE AMERICAN WORKER:

@FiatChrysler_NA has unveiled its plans to invest more than $1 billion in a Michigan plant, give $2k bonuses to 60k employees, &amp; create 2,500 jobs in response to the #TaxCutsandJobsAct.

Read more here: https://t.co/czFkwGLjb7 https://t.co/yuxCudV9gn

